(1,'Inception','2010','0000-00-00 00:00:00',148,'Action, Adventure, Sci-Fi','Dom Cobb is a skilled thief, the absolute best in the dangerous art of extraction, stealing valuable secrets from deep within the subconscious during the dream state, when the mind is at its most vulnerable. Cobb\'s rare ability has made him a coveted player in this treacherous new world of corporate espionage, but it has also made him an international fugitive and cost him everything he has ever loved. Now Cobb is being offered a chance at redemption. One last job could give him his life back but only if he can accomplish the impossible - inception. Instead of the perfect heist, Cobb and his team of specialists have to pull off the reverse: their task is not to steal an idea but to plant one. If they succeed, it could be the perfect crime. But no amount of careful planning or expertise can prepare the team for the dangerous enemy that seems to predict their every move. An enemy that only Cobb could have seen coming.','USA, UK','Won 4 Oscars. Another 152 wins & 204 nominations.','https://ia.media-imdb.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_SX300.jpg','tt1375666','movie',8.8,1,'$292,568,851',1),
(2,'Black Panther','2018','0000-00-00 00:00:00',134,'Action, Adventure, Sci-Fi','After the events of Captain America: Civil War, King T\'Challa returns home to the reclusive, technologically advanced African nation of Wakanda to serve as his country\'s new leader. However, T\'Challa soon finds that he is challenged for the throne from factions within his own country. When two foes conspire to destroy Wakanda, the hero known as Black Panther must team up with C.I.A. agent Everett K. Ross and members of the Dora Milaje, Wakanadan special forces, to prevent Wakanda from being dragged into a world war.','USA','14 nominations.','https://m.media-amazon.com/images/M/MV5BMTg1MTY2MjYzNV5BMl5BanBnXkFtZTgwMTc4NTMwNDI@._V1_SX300.jpg','tt1825683','movie',7.5,324,'$501,105,037',2),
(3,'2001: A Space Odyssey','1968','0000-00-00 00:00:00',149,'Adventure, Sci-Fi','\"2001\" is a story of evolution. Sometime in the distant past, someone or something nudged evolution by placing a monolith on Earth (presumably elsewhere throughout the universe as well). Evolution then enabled humankind to reach the moon\'s surface, where yet another monolith is found, one that signals the monolith placers that humankind has evolved that far. Now a race begins between computers (HAL) and human (Bowman) to reach the monolith placers. The winner will achieve the next step in evolution, whatever that may be.','UK, USA','Won 1 Oscar. Another 13 wins & 10 nominations.','https://ia.media-imdb.com/images/M/MV5BMmNlYzRiNDctZWNhMi00MzI4LThkZTctMTUzMmZkMmFmNThmXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0062622','movie',8.3,503,'$135,620',3),
(4,'Maze','2017','0000-00-00 00:00:00',92,'Adventure, Crime, Drama','Inspired by the true events of the infamous 1983 prison breakout of 38 IRA prisoners from HMP, which was to become the biggest prison escape in Europe since World War II.','UK, Ireland, Sweden, Germany','4 nominations.','https://ia.media-imdb.com/images/M/MV5BZGRiZWMzMDgtYTFhZS00Y2U4LWI5NDItYWNkMWQ1OTIyM2JlXkEyXkFqcGdeQXVyNzQ5MzY0NjM@._V1_SX300.jpg','tt5752606','movie',5.9,1,'N/A',4),
(5,'Old Boy','2013','0000-00-00 00:00:00',104,'Action, Drama, Mystery','An advertising executive is kidnapped and held hostage for 20 years in solitary confinement. When he is inexplicably released, he embarks on an obsessive mission to discover who orchestrated his punishment, only to find he is still trapped in a web of conspiracy and torment.','USA','4 nominations.','https://m.media-amazon.com/images/M/MV5BMTk5NTEwMzI5OV5BMl5BanBnXkFtZTgwMDQ4ODUwMDE@._V1_SX300.jpg','tt1321511','movie',5.8,58,'$1,227,546',5),
(6,'Rocco','2016','0000-00-00 00:00:00',105,'Documentary','Rocco Siffredi is to pornography what Mike Tyson is to boxing or Mick Jagger is to rock\'n\'roll: a living legend. His mother wanted him to be a priest; with her blessing he became a hardcore performer, devoting his life to one God only: Desire. Rocco Siffredi reveals all, even if it sometimes means busting his own myth: his true story, beginnings, career, wife and children... and the ultimate revelation that will change his life forever. A behind-the-scenes account of the porn world and its stars as they\'ve never been seen before - the no-holds-bard portrait of a true giant.','France','1 win.','https://ia.media-imdb.com/images/M/MV5BYzJkN2Q2OTAtNTkxMC00NDIyLWFmMmEtN2QxZTZiNWEzNDU2L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTE1NjkxODU@._V1_SX300.jpg','tt5788462','movie',5.9,1,'N/A',6),
(7,'Thor','2011','0000-00-00 00:00:00',115,'Action, Adventure, Fantasy','The warrior Thor (Hemsworth) is cast out of the fantastic realm of Asgard by his father Odin (Hopkins) for his arrogance and sent to Earth to live among humans. Falling in love with scientist Jane Foster (Portman) teaches Thor much-needed lessons, and his new-found strength comes into play as a villain from his homeland sends dark forces toward Earth.','USA','5 wins & 30 nominations.','https://ia.media-imdb.com/images/M/MV5BOGE4NzU1YTAtNzA3Mi00ZTA2LTg2YmYtMDJmMThiMjlkYjg2XkEyXkFqcGdeQXVyNTgzMDMzMTg@._V1_SX300.jpg','tt0800369','movie',7.0,622,'$181,015,141',7),
(8,'Harry Potter and the Deathly Hallows: Part 2','2011','0000-00-00 00:00:00',130,'Adventure, Drama, Fantasy','Harry, Ron, and Hermione continue their quest of finding and destroying the Dark Lord\'s three remaining Horcruxes, the magical items responsible for his immortality. But as the mystical Deathly Hallows are uncovered, and Voldemort finds out about their mission, the biggest battle begins and life as they know it will never be the same again.','USA, UK','Nominated for 3 Oscars. Another 45 wins & 91 nominations.','https://ia.media-imdb.com/images/M/MV5BMjIyZGU4YzUtNDkzYi00ZDRhLTljYzctYTMxMDQ4M2E0Y2YxXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg','tt1201607','movie',8.1,643,'$381,000,185',8),
(10,'Iron Man','2008','2020-08-21 00:34:01',126,'Action, Adventure, Sci-Fi','Tony Stark. Genius, billionaire, playboy, philanthropist. Son of legendary inventor and weapons contractor Howard Stark. When Tony Stark is assigned to give a weapons presentation to an Iraqi unit led by Lt. Col. James Rhodes, he\'s given a ride on enemy lines. That ride ends badly when Stark\'s Humvee that he\'s riding in is attacked by enemy combatants. He survives - barely - with a chest full of shrapnel and a car battery attached to his heart. In order to survive he comes up with a way to miniaturize the battery and figures out that the battery can power something else. Thus Iron Man is born. He uses the primitive device to escape from the cave in Iraq. Once back home, he then begins work on perfecting the Iron Man suit. But the man who was put in charge of Stark Industries has plans of his own to take over Tony\'s technology for other matters.','USA','Nominated for 2 Oscars. Another 21 wins & 65 nominations.','https://m.media-amazon.com/images/M/MV5BMTczNTI2ODUwOF5BMl5BanBnXkFtZTcwMTU0NTIzMw@@._V1_SX300.jpg','tt0371746','movie',7.9,794,'$318,298,180',10),
(12,'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe','2005','2020-08-21 02:52:28',143,'Adventure, Family, Fantasy','Four children from the same family have to leave their town because of the bombings of WWII. A women and a professor take the children to their house. While playing a game of hide-and-seek, the youngest member of the family, Lucy, finds a wardrobe to hide in. She travels back and back into the wardrobe and finds a place named Narnia. After going in twice, the four children go in together for the last time. They battle wolves, meet talking animals, encounter an evil white witch and meet a magnificent lion named Aslan. Will this be the end of their journey to Narnia or will they stay?','USA, UK','Won 1 Oscar. Another 17 wins & 46 nominations.','https://m.media-amazon.com/images/M/MV5BMTc0NTUwMTU5OV5BMl5BanBnXkFtZTcwNjAwNzQzMw@@._V1_SX300.jpg','tt0363771','movie',6.9,321,'$291,685,219',12),
(13,'Batman','1989','0000-00-00 00:00:00',126,'Action, Adventure','Gotham City. Crime boss Carl Grissom (Jack Palance) effectively runs the town but there\'s a new crime fighter in town - Batman (Michael Keaton). Grissom\'s right-hand man is Jack Napier (Jack Nicholson), a brutal man who is not entirely sane... After falling out between the two Grissom has Napier set up with the Police and Napier falls to his apparent death in a vat of chemicals. However, he soon reappears as The Joker and starts a reign of terror in Gotham City. Meanwhile, reporter Vicki Vale (Kim Basinger) is in the city to do an article on Batman. She soon starts a relationship with Batman\'s everyday persona, billionaire Bruce Wayne.','USA, UK','Won 1 Oscar. Another 8 wins & 26 nominations.','https://ia.media-imdb.com/images/M/MV5BMTYwNjAyODIyMF5BMl5BanBnXkFtZTYwNDMwMDk2._V1_SX300.jpg','tt0096895','movie',7.6,298,'N/A',13),
(14,'Zorro','1975','0000-00-00 00:00:00',120,'Action, Adventure, Comedy','A newly arrived governor finds his province under the control of the corrupt Colonel Huerta. To avoid assassination by Huerta, he pretends to be weak and indecisive so Huerta will believe he poses no threat. But secretly he masquerades as Zorro, and joins the monk Francisco and the beautiful aristocrat Ortensia in their fight for justice against Huerta and his soldiers.','Italy, France','N/A','https://images-na.ssl-images-amazon.com/images/M/MV5BOWFlYWJkMjMtNzVlZi00MjA2LWI3YzAtMmYxNzY5NjA2NWMzXkEyXkFqcGdeQXVyMjQzMzQzODY@._V1_SX300.jpg','tt0072448','movie',6.6,2,'N/A',14),
(15,'King Kong','2005','0000-00-00 00:00:00',187,'Action, Adventure, Drama','Carl Denham needs to finish his movie and has the perfect location; Skull Island. But he still needs to find a leading lady. This \'soon-to-be-unfortunate\' soul is Ann Darrow. No one knows what they will encounter on this island and why it is so mysterious, but once they reach it, they will soon find out. Living on this hidden island is a giant gorilla and this beast now has Ann is its grasps. Carl and Ann\'s new love, Jack Driscoll must travel through the jungle looking for Kong and Ann, whilst avoiding all sorts of creatures and beasts. But Carl has another plan in mind.','New Zealand, USA, Germany','Won 3 Oscars. Another 43 wins & 100 nominations.','https://ia.media-imdb.com/images/M/MV5BMjYxYmRlZWYtMzAwNC00MDA1LWJjNTItOTBjMzlhNGMzYzk3XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0360717','movie',7.2,350,'$218,100,000',15),
(16,'Godzilla','2014','0000-00-00 00:00:00',123,'Action, Adventure, Sci-Fi','In 1999, the Janjira nuclear plant was mysteriously destroyed with most hands lost including supervisor Joe Brody\'s colleague and wife, Sandra. Years later, Joe\'s son, Ford, a US Navy ordnance disposal officer, must go to Japan to help his estranged father who obsessively searches for the truth of the incident. In doing so, father and son discover the disaster\'s secret cause on the wreck\'s very grounds. This enables them to witness the reawakening of a terrible threat to all of Humanity, which is made all the worse with a second secret revival elsewhere. Against this cataclysm, the only hope for the world may be Godzilla, but the challenge for the King of the Monsters will be great even as Humanity struggles to understand the destructive ally they have.','USA, Japan','6 wins & 31 nominations.','https://ia.media-imdb.com/images/M/MV5BN2E4ZDgxN2YtZjExMS00MWE5LTg3NjQtNTkxMzJhOTA3MDQ4XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0831387','movie',6.4,331,'$172,962,996',16),
(17,'Zoo','2007','0000-00-00 00:00:00',75,'Documentary','A look at the life of an Enumclaw, Washington man who died as a result of an unusual encounter with a horse.','USA','1 win & 4 nominations.','https://images-na.ssl-images-amazon.com/images/M/MV5BNTk3MjkwODQ1OF5BMl5BanBnXkFtZTcwNzgzMTM0MQ@@._V1_SX300.jpg','tt0874423','movie',5.6,2,'N/A',17),
(18,'Peter Pan','1953','0000-00-00 00:00:00',77,'Animation, Adventure, Family','An adaptation of J. M. Barrie\'s story about a boy who never grew up. The three children of the Darling family receive a visit from Peter Pan, who takes them to Never Land, where an ongoing war between Peter\'s gang of rag-tag runaways and the evil Pirate Captain Hook is taking place.','USA','2 nominations.','https://ia.media-imdb.com/images/M/MV5BMzIwMzUyYTUtMjQ3My00NDc3LWIyZjQtOGUzNDJmNTFlNWUxXkEyXkFqcGdeQXVyMjA0MDQ0Mjc@._V1_SX300.jpg','tt0046183','movie',7.3,103,'N/A',18),
(19,'Nemo','1984','0000-00-00 00:00:00',97,'Adventure, Fantasy','A young boy imagines being in a tale he\'s about to hear. In this magical world he encounters many famous characters from other tales, aliens and other beings and, of course, a beautiful princess.','France, UK, USA','1 nomination.','https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NzIwMTgwN15BMl5BanBnXkFtZTcwMjIyMzMzMQ@@._V1_SX300.jpg','tt0087784','movie',4.9,170,'N/A',19),
(20,'Jumanji','1995','0000-00-00 00:00:00',104,'Adventure, Family, Fantasy','After being trapped in a jungle board game for 26 years, a Man-Child wins his release from the game. But, no sooner has he arrived that he is forced to play again, and this time sets the creatures of the jungle loose on the city. Now it is up to him to stop them.','USA','4 wins & 9 nominations.','https://ia.media-imdb.com/images/M/MV5BZTk2ZmUwYmEtNTcwZS00YmMyLWFkYjMtNTRmZDA3YWExMjc2XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0113497','movie',6.9,252,'N/A',20),
(21,'The Dark Knight','2008','0000-00-00 00:00:00',152,'Action, Crime, Drama','Set within a year after the events of Batman Begins, Batman, Lieutenant James Gordon, and new district attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City until a mysterious and sadistic criminal mastermind known only as the Joker appears in Gotham, creating a new wave of chaos. Batman\'s struggle against the Joker becomes deeply personal, forcing him to \"confront everything he believes\" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent and Rachel Dawes.','USA, UK','Won 2 Oscars. Another 152 wins & 155 nominations.','https://ia.media-imdb.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_SX300.jpg','tt0468569','movie',9.0,1,'$533,316,061',1),
(22,'The Lord of the Rings: The Fellowship of the Ring','2001','2020-08-20 23:12:24',178,'Adventure, Drama, Fantasy','An ancient Ring thought lost for centuries has been found, and through a strange twist in fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it! However he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Boromir and his three Hobbit friends Merry, Pippin and Samwise. Through mountains, snow, darkness, forests, rivers and plains, facing evil and danger at every corner the Fellowship of the Ring must go. Their quest to destroy the One Ring is the only hope for the end of the Dark Lords reign!','New Zealand, USA','Won 4 Oscars. Another 114 wins & 124 nominations.','https://m.media-amazon.com/images/M/MV5BN2EyZjM3NzUtNWUzMi00MTgxLWI0NTctMzY4M2VlOTdjZWRiXkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_SX300.jpg','tt0120737','movie',8.8,1,'$314,000,000',15),
(23,'Star Wars: Episode IV - A New Hope','1977','2020-08-21 02:51:14',121,'Action, Adventure, Fantasy','The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.','USA','Won 6 Oscars. Another 52 wins & 28 nominations.','https://m.media-amazon.com/images/M/MV5BNzVlY2MwMjktM2E4OS00Y2Y3LWE3ZjctYzhkZGM3YzA1ZWM2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0076759','movie',8.6,1,'N/A',21),
(24,'The Avengers','2012','2020-08-19 17:07:40',143,'Action, Adventure, Sci-Fi','Nick Fury is the director of S.H.I.E.L.D., an international peace-keeping agency. The agency is a who\'s who of Marvel Super Heroes, with Iron Man, The Incredible Hulk, Thor, Captain America, Hawkeye and Black Widow. When global security is threatened by Loki and his cohorts, Nick Fury and his team will need all their powers to save the world from disaster.','USA','Nominated for 1 Oscar. Another 38 wins & 79 nominations.','https://m.media-amazon.com/images/M/MV5BNDYxNjQyMjAtNTdiOS00NGYwLWFmNTAtNThmYjU5ZGI2YTI1XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg','tt0848228','movie',8.0,1,'$623,279,547',22),
(25,'World War Z','2013','2020-08-20 23:12:41',116,'Action, Adventure, Horror','Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.','USA','3 wins & 24 nominations.','https://m.media-amazon.com/images/M/MV5BNDQ4YzFmNzktMmM5ZC00MDZjLTk1OTktNDE2ODE4YjM2MjJjXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg','tt0816711','movie',7.0,524,'$202,351,611',23),
(26,'The Shawshank Redemption','1994','2020-08-20 23:34:13',142,'Crime, Drama','Chronicles the experiences of a formerly successful banker as a prisoner in the gloomy jailhouse of Shawshank after being found guilty of a crime he did not commit. The film portrays the man\'s unique way of dealing with his new, torturous life; along the way he befriends a number of fellow prisoners, most notably a wise long-term inmate named Red.','USA','Nominated for 7 Oscars. Another 21 wins & 35 nominations.','https://m.media-amazon.com/images/M/MV5BMDFkYTc0MGEtZmNhMC00ZDIzLWFmNTEtODM1ZmRlYWMwMWFmXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg','tt0111161','movie',9.3,1,'N/A',24),
(27,'Catch Me If You Can','2002','0000-00-00 00:00:00',141,'Biography, Crime, Drama','New Rochelle, the 1960s. High schooler Frank Abagnale Jr. idolizes his father, who\'s in trouble with the IRS. When his parents separate, Frank runs away to Manhattan with $25 in his checking account, vowing to regain dad\'s losses and get his parents back together. Just a few years later, the FBI tracks him down in France; he\'s extradited, tried, and jailed for passing more than $4,000,000 in bad checks. Along the way, he\'s posed as a Pan Am pilot, a pediatrician, and an attorney. And, from nearly the beginning of this life of crime, he\'s been pursued by a dour FBI agent, Carl Hanratty. What starts as cat and mouse becomes something akin to father and son.','USA, Canada','Nominated for 2 Oscars. Another 13 wins & 41 nominations.','https://ia.media-imdb.com/images/M/MV5BMTY5MzYzNjc5NV5BMl5BanBnXkFtZTYwNTUyNTc2._V1_SX300.jpg','tt0264464','movie',8.1,657,'$164,400,000',25),
(28,'Django Unchained','2012','0000-00-00 00:00:00',165,'Drama, Western','A German dentist buys the freedom of a slave and trains him with the intent to make him his deputy bounty hunter. Instead, he is led to the site of the slave\'s wife who belongs to a ruthless plantation owner.','USA','Won 2 Oscars. Another 56 wins & 151 nominations.','https://ia.media-imdb.com/images/M/MV5BMjIyNTQ5NjQ1OV5BMl5BanBnXkFtZTcwODg1MDU4OA@@._V1_SX300.jpg','tt1853728','movie',8.4,1,'$162,804,648',26),
(29,'Pulp Fiction','1994','0000-00-00 00:00:00',154,'Crime, Drama','Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose his fight. The lives of these seemingly unrelated people are woven together comprising of a series of funny, bizarre and uncalled-for incidents.','USA','Won 1 Oscar. Another 62 wins & 69 nominations.','https://ia.media-imdb.com/images/M/MV5BNGNhMDIzZTUtNTBlZi00MTRlLWFjM2ItYzViMjE3YzI5MjljXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0110912','movie',8.9,1,'N/A',26),
(30,'Quantum of Solace','2008','0000-00-00 00:00:00',106,'Action, Adventure, Thriller','Is there solace in revenge? Bond and \"M\" sniff a shadowy international network of power and corruption reaping billions. As Bond pursues the agents of an assassination attempt on \"M,\" all roads lead to Dominic Greene, a world-renowned developer of green technology. Greene, a nasty piece of work, is intent on securing a barren area of Bolivia in exchange for assisting a strongman stage a coup there. The CIA looks the other way, and only Bond, with help from a retired spy and from a mysterious beauty, stands in Greene\'s way. \"M\" wonders if she can trust Bond, or if vengeance possesses him. Beyond that, can anyone drawn to Bond live to tell the tale?','UK, USA','Nominated for 2 BAFTA Film Awards. Another 4 wins & 30 nominations.','https://m.media-amazon.com/images/M/MV5BMjZiYTUzMzktZWI5Yy00Mzk4LWFlMDgtYjRmNWU0Mzc0MzNiXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_SX300.jpg','tt0830515','movie',6.6,362,'$168,400,000',23),
(31,'Fight Club','1999','0000-00-00 00:00:00',139,'Drama','A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making scheme. Together the two men spiral out of control and engage in competitive rivalry for love and power. When the narrator is exposed to the hidden agenda of Tyler\'s fight club, he must accept the awful truth that Tyler may not be who he says he is.','USA, Germany','Nominated for 1 Oscar. Another 10 wins & 34 nominations.','https://m.media-amazon.com/images/M/MV5BMjJmYTNkNmItYjYyZC00MGUxLWJhNWMtZDY4Nzc1MDAwMzU5XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0137523','movie',8.8,1,'N/A',27),
