(52,'V for Vendetta','2005','2020-08-20 19:18:40',132,'Action, Drama, Sci-Fi','Tells the story of Evey Hammond and her unlikely but instrumental part in bringing down the fascist government that has taken control of a futuristic Great Britain. Saved from a life-and-death situation by a man in a Guy Fawkes mask who calls himself V, she learns a general summary of V\'s past and, after a time, decides to help him bring down those who committed the atrocities that led to Britain being in the shape that it is in.','USA, UK, Germany','7 wins & 27 nominations.','https://m.media-amazon.com/images/M/MV5BOTI5ODc3NzExNV5BMl5BanBnXkFtZTcwNzYxNzQzMw@@._V1_SX300.jpg','tt0434409','movie',8.2,904,'$70,500,000',46),
(53,'Her','2013','0000-00-00 00:00:00',126,'Drama, Romance, Sci-Fi','Theodore is a lonely man in the final stages of his divorce. When he\'s not working as a letter writer, his down time is spent playing video games and occasionally hanging out with friends. He decides to purchase the new OS1, which is advertised as the world\'s first artificially intelligent operating system, \"It\'s not just an operating system, it\'s a consciousness,\" the ad states. Theodore quickly finds himself drawn in with Samantha, the voice behind his OS1. As they start spending time together they grow closer and closer and eventually find themselves in love. Having fallen in love with his OS, Theodore finds himself dealing with feelings of both great joy and doubt. As an OS, Samantha has powerful intelligence that she uses to help Theodore in ways others hadn\'t, but how does she help him deal with his inner conflict of being in love with an OS?','USA','Won 1 Oscar. Another 82 wins & 181 nominations.','https://ia.media-imdb.com/images/M/MV5BMjA1Nzk0OTM2OF5BMl5BanBnXkFtZTgwNjU2NjEwMDE@._V1_SX300.jpg','tt1798709','movie',8.0,427,'$17,901,029',47),
(54,'Memento','2000','0000-00-00 00:00:00',113,'Mystery, Thriller','Memento chronicles two separate stories of Leonard, an ex-insurance investigator who can no longer build new memories, as he attempts to find the murderer of his wife, which is the last thing he remembers. One story line moves forward in time while the other tells the story backwards revealing more each time.','USA','Nominated for 2 Oscars. Another 56 wins & 55 nominations.','https://ia.media-imdb.com/images/M/MV5BZTcyNjk1MjgtOWI3Mi00YzQwLWI5MTktMzY4ZmI2NDAyNzYzXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg','tt0209144','movie',8.5,972,'$23,844,220',1),
(55,'Mr. Nobody','2009','0000-00-00 00:00:00',141,'Drama, Fantasy, Romance','In the year 2092, one hundred eighteen year old Nemo is recounting his life story to a reporter. He is less than clear, often times thinking that he is only thirty-four years of age. But his story becomes more confusing after he does focus on the fact of his current real age. He tells of his life at three primary points in his life: at age nine (when his parents divorced), age sixteen and age thirty-four. The confusing aspect of the story is that he tells of alternate life paths, often changing course with the flick of a decision at each of those ages. One life path has him ultimately married to Elise, a depressed woman who never got over the unrequited love she had for a guy named Stefano when she was a teenager and who asked Nemo to swear that when she died he would sprinkle her ashes on Mars. A second life path has him married to Jean. Their life is one of luxury but one also of utter boredom. And a third life path has him in a torrid romance with his step-sister Anna, the two who, as adults, would search for each other after having been torn apart as teenagers. These life paths also intersect, with the three women sometimes entering the alternate life in some other aspect. Are any of these lives real or are they all a figment of his imagination?','Belgium, Germany, Canada, France, USA, UK','11 wins & 5 nominations.','https://ia.media-imdb.com/images/M/MV5BMTg4ODkzMDQ3Nl5BMl5BanBnXkFtZTgwNTEwMTkxMDE@._V1_SX300.jpg','tt0485947','movie',7.9,183,'$3,600',48),
(56,'Gravity','2013','0000-00-00 00:00:00',91,'Drama, Sci-Fi, Thriller','Dr. Ryan Stone (Sandra Bullock) is a brilliant medical engineer on her first shuttle mission, with veteran astronaut Matt Kowalski (George Clooney) in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The shuttle is destroyed, leaving Stone and Kowalsky completely alone - tethered to nothing but each other and spiraling out into the blackness.','UK, USA','Won 7 Oscars. Another 232 wins & 175 nominations.','https://m.media-amazon.com/images/M/MV5BNjE5MzYwMzYxMF5BMl5BanBnXkFtZTcwOTk4MTk0OQ@@._V1_SX300.jpg','tt1454468','movie',7.8,666,'$274,084,951',49),
(57,'Lucky Number Slevin','2006','0000-00-00 00:00:00',110,'Crime, Drama, Mystery','In an airport waiting room, a man in a wheelchair tells a stranger a story about a fixed horse race in 1979 that resulted in a family\'s deaths. In Manhattan, two bookies and the son of a Mob boss die. A young man just out of the shower answers the door to a neighbor woman and explains that he\'s visiting, has had a bad week, including being mugged, and doesn\'t know where his pal, who lives there, is. The neighbor is chatty; she\'s a coroner. Two thugs arrive and, believing the visitor to be the guy who lives there, take him to see the boss with the dead son, who tells him to kill the son of his Mob rival. Mistaken identity? What connects the threads? Cops are watching.','Germany, UK, USA, Canada','5 wins & 4 nominations.','https://ia.media-imdb.com/images/M/MV5BZjczMWI1YWMtYTZjOS00ZDc5LWE2MWItMTY3ZGUxNzFkNjJmL2ltYWdlXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg','tt0425210','movie',7.8,281,'N/A',50),
(58,'Avatar','2009','0000-00-00 00:00:00',162,'Action, Adventure, Fantasy','When his brother is killed in a robbery, paraplegic Marine Jake Sully decides to take his place in a mission on the distant world of Pandora. There he learns of greedy corporate figurehead Parker Selfridge\'s intentions of driving off the native humanoid \"Na\'vi\" in order to mine for the precious material scattered throughout their rich woodland. In exchange for the spinal surgery that will fix his legs, Jake gathers intel for the cooperating military unit spearheaded by gung-ho Colonel Quaritch, while simultaneously attempting to infiltrate the Na\'vi people with the use of an \"avatar\" identity. While Jake begins to bond with the native tribe and quickly falls in love with the beautiful alien Neytiri, the restless Colonel moves forward with his ruthless extermination tactics, forcing the soldier to take a stand - and fight back in an epic battle for the fate of Pandora.','UK, USA','Won 3 Oscars. Another 85 wins & 128 nominations.','https://m.media-amazon.com/images/M/MV5BMTYwOTEwNjAzMl5BMl5BanBnXkFtZTcwODc5MTUwMw@@._V1_SX300.jpg','tt0499549','movie',7.8,989,'$749,700,000',51),
