(72,'Ant-Man','2015','0000-00-00 00:00:00',117,'Action, Adventure, Comedy','Armed with the astonishing ability to shrink in scale but increase in strength, con-man Scott Lang must embrace his inner-hero and help his mentor, Dr. Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.','USA','Nominated for 1 BAFTA Film Award. Another 3 wins & 32 nominations.','https://ia.media-imdb.com/images/M/MV5BMjM2NTQ5Mzc2M15BMl5BanBnXkFtZTgwNTcxMDI2NTE@._V1_SX300.jpg','tt0478970','movie',7.3,428,'$138,002,223',61),
(73,'A Clockwork Orange','1971','0000-00-00 00:00:00',136,'Crime, Drama, Sci-Fi','Protagonist Alex DeLarge is an \"ultraviolent\" youth in futuristic Britain. As with all luck, his eventually runs out and he\'s arrested and convicted of murder and rape. While in prison, Alex learns of an experimental program in which convicts are programmed to detest violence. If he goes through the program, his sentence will be reduced and he will be back on the streets sooner than expected. But Alex\'s ordeals are far from over once he hits the mean streets of Britain that he had a hand in creating.','UK, USA','Nominated for 4 Oscars. Another 9 wins & 19 nominations.','https://m.media-amazon.com/images/M/MV5BMTY3MjM1Mzc4N15BMl5BanBnXkFtZTgwODM0NzAxMDE@._V1_SX300.jpg','tt0066921','movie',8.3,647,'N/A',3),
(74,'Kill Bill: Vol. 1','2003','2020-08-20 19:21:15',111,'Action, Crime, Thriller','The lead character, called \'The Bride,\' was a member of the Deadly Viper Assassination Squad, led by her lover \'Bill.\' Upon realizing she was pregnant with Bill\'s child, \'The Bride\' decided to escape her life as a killer. She fled to Texas, met a young man, who, on the day of their wedding rehearsal was gunned down by an angry and jealous Bill (with the assistance of the Deadly Viper Assassination Squad). Four years later, \'The Bride\' wakes from a coma, and discovers her baby is gone. She, then, decides to seek revenge upon the five people who destroyed her life and killed her baby. The saga of Kill Bill Volume I begins.','USA','Nominated for 1 Golden Globe. Another 28 wins & 102 nominations.','https://m.media-amazon.com/images/M/MV5BNzM3NDFhYTAtYmU5Mi00NGRmLTljYjgtMDkyODQ4MjNkMGY2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0266697','movie',8.1,845,'N/A',26),
