(119,'The Grand Budapest Hotel','2014','2020-08-20 12:27:20',99,'Adventure, Comedy, Drama','GRAND BUDAPEST HOTEL recounts the adventures of Gustave H, a legendary concierge at a famous European hotel between the wars, and Zero Moustafa, the lobby boy who becomes his most trusted friend. The story involves the theft and recovery of a priceless Renaissance painting and the battle for an enormous family fortune -- all against the back-drop of a suddenly and dramatically changing Continent.','USA, Germany','Won 4 Oscars. Another 130 wins & 225 nominations.','https://m.media-amazon.com/images/M/MV5BMzM5NjUxOTEyMl5BMl5BanBnXkFtZTgwNjEyMDM0MDE@._V1_SX300.jpg','tt2278388','movie',8.1,586,'$56,939,515',85),
