(121,'Drive','2011','0000-00-00 00:00:00',100,'Crime, Drama','A mysterious man who has multiple jobs as a garage mechanic, a Hollywood stuntman and a getaway driver seems to be trying to escape his shady past as he falls for his neighbor - whose husband is in prison and who\'s looking after her child alone. Meanwhile, his garage mechanic boss is trying to set up a race team using gangland money, which implicates our driver as he is to be used as the race team\'s main driver. Our hero gets more than he bargained for when he meets the man who is married to the woman he loves.','USA','Nominated for 1 Oscar. Another 77 wins & 170 nominations.','https://m.media-amazon.com/images/M/MV5BZjY5ZjQyMjMtMmEwOC00Nzc2LTllYTItMmU2MzJjNTg1NjY0XkEyXkFqcGdeQXVyNjQ1MTMzMDQ@._V1_SX300.jpg','tt0780504','movie',7.8,494,'$34,300,000',67),
(122,'Saving Private Ryan','1998','0000-00-00 00:00:00',169,'Drama, War','Opening with the Allied invasion of Normandy on 6 June 1944, members of the 2nd Ranger Battalion under Cpt. Miller fight ashore to secure a beachhead. Amidst the fighting, two brothers are killed in action. Earlier in New Guinea, a third brother is KIA. Their mother, Mrs. Ryan, is to receive all three of the grave telegrams on the same day. The United States Army Chief of Staff, George C. Marshall, is given an opportunity to alleviate some of her grief when he learns of a fourth brother, Private James Ryan, and decides to send out 8 men (Cpt. Miller and select members from 2nd Rangers) to find him and bring him back home to his mother...','USA','Won 5 Oscars. Another 74 wins & 74 nominations.','https://m.media-amazon.com/images/M/MV5BZjhkMDM4MWItZTVjOC00ZDRhLThmYTAtM2I5NzBmNmNlMzI1XkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_SX300.jpg','tt0120815','movie',8.6,1,'N/A',25),
(123,'The Shape of Water','2017','0000-00-00 00:00:00',123,'Adventure, Drama, Fantasy','At a top secret research facility in the 1960s, a lonely janitor forms a unique relationship with an amphibious creature that is being held in captivity.','USA','Won 4 Oscars. Another 101 wins & 293 nominations.','https://m.media-amazon.com/images/M/MV5BNGNiNWQ5M2MtNGI0OC00MDA2LWI5NzEtMmZiYjVjMDEyOWYzXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg','tt5580390','movie',7.4,224,'$57,393,976',86),
(124,'Shaun of the Dead','2004','0000-00-00 00:00:00',99,'Comedy, Horror','Shaun doesn\'t have a very good day, so he decides to turn his life around by getting his ex to take him back, but he times it for right in the middle of what may be a zombie apocalypse... But for him, it\'s an opportunity to show everyone he knows how useful he is by saving them all. All he has to do is survive... And get his ex back.','UK, France','13 wins & 20 nominations.','https://ia.media-imdb.com/images/M/MV5BMTg5Mjk2NDMtZTk0Ny00YTQ0LWIzYWEtMWI5MGQ0Mjg1OTNkXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg','tt0365748','movie',8.0,443,'$13,464,388',87),
(126,'Spider-Man','2002','0000-00-00 00:00:00',121,'Action, Adventure, Sci-Fi','Based on Marvel Comics\' superhero character, this is a story of Peter Parker who is a nerdy high-schooler. He was orphaned as a child, bullied by jocks, and can\'t confess his crush for his stunning neighborhood girl Mary Jane Watson. To say his life is \"miserable\" is an understatement. But one day while on an excursion to a laboratory a runaway radioactive spider bites him... and his life changes in a way no one could have imagined. Peter acquires a muscle-bound physique, clear vision, ability to cling to surfaces and crawl over walls, shooting webs from his wrist ... but the fun isn\'t going to last. An eccentric millionaire Norman Osborn administers a performance enhancing drug on himself and his maniacal alter ego Green Goblin emerges. Now Peter Parker has to become Spider-Man and take Green Goblin to the task... or else Goblin will kill him. They come face to face and the war begins in which only one of them will survive at the end.','USA','Nominated for 2 Oscars. Another 16 wins & 58 nominations.','https://m.media-amazon.com/images/M/MV5BZDEyN2NhMjgtMjdhNi00MmNlLWE5YTgtZGE4MzNjMTRlMGEwXkEyXkFqcGdeQXVyNDUyOTg3Njg@._V1_SX300.jpg','tt0145487','movie',7.3,608,'$403,706,375',89),
(127,'The Amazing Spider-Man','2012','0000-00-00 00:00:00',136,'Action, Adventure, Sci-Fi','Peter Parker (Garfield) is an outcast high schooler who was abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben (Sheen) and Aunt May (Field). Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. Peter is also finding his way with his first high school crush, Gwen Stacy (Stone), and together, they struggle with love, commitment, and secrets. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance - leading him directly to Oscorp and the lab of Dr. Curt Connors (Ifans), his father\'s former partner. As Spider-Man is set on a collision course with Connors\' alter-ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.','USA','2 wins & 31 nominations.','https://ia.media-imdb.com/images/M/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_SX300.jpg','tt0948470','movie',7.0,500,'$262,030,663',90),
(128,'Spider-Man 2','2004','0000-00-00 00:00:00',127,'Action, Adventure, Sci-Fi','Peter Parker is an unhappy man: after two years of fighting crime as Spider-Man, his life has begun to fall apart. The girl he loves is engaged to someone else, his grades are slipping, he cannot keep any of his jobs, and on top of it, the newspaper Daily Bugle is attacking him viciously, claiming that Spider-Man is a criminal. He reaches the breaking point and gives up the crime fighter\'s life, once and for all. But after a failed fusion experiment, eccentric and obsessive scientist Dr. Otto Octavius is transformed into super villain Doctor Octopus, Doc Ock for short, having four long tentacles as extra hands. Peter guesses it might just be time for Spider-Man to return, but would he act upon it?','USA','Won 1 Oscar. Another 23 wins & 59 nominations.','https://m.media-amazon.com/images/M/MV5BMzY2ODk4NmUtOTVmNi00ZTdkLTlmOWYtMmE2OWVhNTU2OTVkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0316654','movie',7.3,470,'$373,377,893',89),
(129,'Spider-Man 3','2007','0000-00-00 00:00:00',139,'Action, Adventure, Sci-Fi','Peter Parker has finally managed to piece together the once-broken parts of his life, maintaining a balance between his relationship with Mary-Jane and his responsibility as Spider-Man. But more challenges arise for our young hero. Peter\'s old friend Harry Obsourne has set out for revenge against Peter; taking up the mantle of his late father\'s persona as The New Goblin, and Peter must also capture Uncle Ben\'s real killer, Flint Marko, who has been transformed into his toughest foe yet, the Sandman. All hope seems lost when suddenly Peter\'s suit turns jet-black and greatly amplifies his powers. But it also begins to greatly amplify the much darker qualities of Peter\'s personality that he begins to lose himself to. Peter has to reach deep inside himself to free the compassionate hero he used to be if he is to ever conquer the darkness within and face not only his greatest enemies, but also...himself.','USA','Nominated for 1 BAFTA Film Award. Another 3 wins & 32 nominations.','https://m.media-amazon.com/images/M/MV5BYTk3MDljOWQtNGI2My00OTEzLTlhYjQtOTQ4ODM2MzUwY2IwXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg','tt0413300','movie',6.2,433,'$336,530,303',89),
(130,'The Amazing Spider-Man 2','2014','0000-00-00 00:00:00',142,'Action, Adventure, Sci-Fi','We\'ve always known that Spider-Man\'s most important conflict has been within himself: the struggle between the ordinary obligations of Peter Parker and the extraordinary responsibilities of Spider-Man. But in The Amazing Spider-Man 2, Peter Parker finds that his greatest battle is about to begin. It\'s great to be Spider-Man. For Peter Parker, there\'s no feeling quite like swinging between skyscrapers, embracing being the hero, and spending time with Gwen. But being Spider-Man comes at a price: only Spider-Man can protect his fellow New Yorkers from the formidable villains that threaten the city. With the emergence of Electro, Peter must confront a foe far more powerful than he. And as his old friend, Harry Osborn, returns, Peter comes to realize that all of his enemies have one thing in common: Oscorp.','USA','3 wins & 29 nominations.','https://ia.media-imdb.com/images/M/MV5BOTA5NDYxNTg0OV5BMl5BanBnXkFtZTgwODE5NzU1MTE@._V1_SX300.jpg','tt1872181','movie',6.7,364,'$183,277,573',90),
(131,'Spider-Man: Homecoming','2017','0000-00-00 00:00:00',133,'Action, Adventure, Sci-Fi','Thrilled by his experience with the Avengers, Peter returns home, where he lives with his Aunt May, under the watchful eye of his new mentor Tony Stark, Peter tries to fall back into his normal daily routine - distracted by thoughts of proving himself to be more than just your friendly neighborhood Spider-Man - but when the Vulture emerges as a new villain, everything that Peter holds most important will be threatened.','USA','4 wins & 9 nominations.','https://m.media-amazon.com/images/M/MV5BNTk4ODQ1MzgzNl5BMl5BanBnXkFtZTgwMTMyMzM4MTI@._V1_SX300.jpg','tt2250912','movie',7.5,330,'$334,166,825',91),
(132,'Thor: Ragnarok','2017','0000-00-00 00:00:00',130,'Action, Adventure, Comedy','Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his homeworld and the end of Asgardian civilization, at the hands of an all-powerful new threat, the ruthless Hela.','USA','5 wins & 30 nominations.','https://ia.media-imdb.com/images/M/MV5BMjMyNDkzMzI1OF5BMl5BanBnXkFtZTgwODcxODg5MjI@._V1_SX300.jpg','tt3501632','movie',7.9,336,'$314,971,245',92),
(133,'Captain America: The Winter Soldier','2014','0000-00-00 00:00:00',136,'Action, Adventure, Sci-Fi','For Steve Rogers, awakening after decades of suspended animation involves more than catching up on pop culture; it also means that this old school idealist must face a world of subtler threats and difficult moral complexities. That becomes clear when Director Nick Fury is killed by the mysterious assassin, the Winter Soldier, but not before warning Rogers that SHIELD has been subverted by its enemies. When Rogers acts on Fury\'s warning to trust no one there, he is branded as a traitor by the organization. Now a fugitive, Captain America must get to the bottom of this deadly mystery with the help of the Black Widow and his new friend, The Falcon. However, the battle will be costly for the Sentinel of Liberty, with Rogers finding enemies where he least expects them while learning that the Winter Soldier looks disturbingly familiar.','USA','Nominated for 1 Oscar. Another 5 wins & 50 nominations.','https://ia.media-imdb.com/images/M/MV5BMjM2NzUzNzQwNl5BMl5BanBnXkFtZTgwMDQ1MDkwMTE@._V1_SX300.jpg','tt1843866','movie',7.8,598,'$228,636,083',93),
(134,'Captain America: The First Avenger','2011','2020-08-19 17:10:36',124,'Action, Adventure, Sci-Fi','It is 1942, America has entered World War II, and sickly but determined Steve Rogers is frustrated at being rejected yet again for military service. Everything changes when Dr. Erskine recruits him for the secret Project Rebirth. Proving his extraordinary courage, wits and conscience, Rogers undergoes the experiment and his weak body is suddenly enhanced into the maximum human potential. When Dr. Erskine is then immediately assassinated by an agent of Nazi Germany\'s secret HYDRA research department (headed by Johann Schmidt, a.k.a. the Red Skull), Rogers is left as a unique man who is initially misused as a propaganda mascot; however, when his comrades need him, Rogers goes on a successful adventure that truly makes him Captain America, and his war against Schmidt begins.','USA','4 wins & 46 nominations.','https://m.media-amazon.com/images/M/MV5BMTYzOTc2NzU3N15BMl5BanBnXkFtZTcwNjY3MDE3NQ@@._V1_SX300.jpg','tt0458339','movie',6.9,596,'$176,636,816',20),
(135,'Edge of Tomorrow','2014','0000-00-00 00:00:00',113,'Action, Adventure, Sci-Fi','An alien race has hit the Earth in an unrelenting assault, unbeatable by any military unit in the world. Major William Cage (Cruise) is an officer who has never seen a day of combat when he is unceremoniously dropped into what amounts to a suicide mission. Killed within minutes, Cage now finds himself inexplicably thrown into a time loop-forcing him to live out the same brutal combat over and over, fighting and dying again...and again. But with each battle, Cage becomes able to engage the adversaries with increasing skill, alongside Special Forces warrior Rita Vrataski (Blunt). And, as Cage and Vrataski take the fight to the aliens, each repeated encounter gets them one step closer to defeating the enemy!','USA, Canada','11 wins & 37 nominations.','https://m.media-amazon.com/images/M/MV5BMTc5OTk4MTM3M15BMl5BanBnXkFtZTgwODcxNjg3MDE@._V1_SX300.jpg','tt1631867','movie',7.9,512,'$77,121,429',94),
(136,'Guardians of the Galaxy','2014','0000-00-00 00:00:00',121,'Action, Adventure, Sci-Fi','After stealing a mysterious orb in the far reaches of outer space, Peter Quill from Earth, is now the main target of a manhunt led by the villain known as Ronan the Accuser. To help fight Ronan and his team and save the galaxy from his power, Quill creates a team of space heroes known as the \"Guardians of the Galaxy\" to save the world.','USA','Nominated for 2 Oscars. Another 52 wins & 99 nominations.','https://ia.media-imdb.com/images/M/MV5BMTAwMjU5OTgxNjZeQTJeQWpwZ15BbWU4MDUxNDYxODEx._V1_SX300.jpg','tt2015381','movie',8.1,835,'$270,592,504',95),
(137,'Holy Motors','2012','0000-00-00 00:00:00',115,'Drama, Fantasy','We see a few seconds of a black and white, silent art film. There is a dark movie theater filled with people watching this film. The camera mostly remains on the audience. Cut to a man sleeping on twin bed with a sleeping dog next to another empty twin bed with the same sheets. He gets up and looks out the window and we see he is next to an airport. One of the walls is covered in wallpaper with skinny bare trees. He puts his ear to the wall. There is a hole in the wall and he looks through it but we don\'t know if he can see anything. He has a metal instrument on the middle finger of his right hand. He sticks the instrument into the hole in the wall. His hand shakes a little and he turns the instrument. This allows him to open a door in the wall. The dog joins him as he steps through the door. There is a set of double doors and he steps through them. It seems as though he has stepped through the fire exit on the balcony of a movie theater, presumably the theatre that the film opened in. The balcony is empty but the lower part of the theater is full. Cut to a new scene; daytime, a house, a family outside. The bids farewell to his children as he leaves for work. The man walks to a limo. The driver, Celine, is waiting for him. The man\'s name is Mr. Oscar.','France, Germany','29 wins & 68 nominations.','https://images-na.ssl-images-amazon.com/images/M/MV5BODk2MDc4MDk2OF5BMl5BanBnXkFtZTcwMTcyODY1OA@@._V1_SX300.jpg','tt2076220','movie',7.1,33,'$641,054',96),
(138,'Hot Fuzz','2007','0000-00-00 00:00:00',121,'Action, Comedy','Top London cop, PC Nicholas Angel is good. Too good. And to stop the rest of his team looking bad, he is reassigned to the quiet town of Sandford. He is paired with Danny Butterman, who endlessly questions him on the action lifestyle. Everything seems quiet for Angel, until two actors are found decapitated. It is called an accident, but Angel isn\'t going to accept that, especially when more and more people turn up dead. Angel and Danny clash with everyone, whilst trying to uncover the truth behind the mystery of the apparent \"accidents\".','UK, France','2 wins & 9 nominations.','https://ia.media-imdb.com/images/M/MV5BMzg4MDJhMDMtYmJiMS00ZDZmLThmZWUtYTMwZDM1YTc5MWE2XkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg','tt0425112','movie',7.9,399,'$23,618,786',87),
(139,'10 Cloverfield Lane','2016','0000-00-00 00:00:00',103,'Drama, Horror, Mystery','After a car accident, Michelle awakens to find herself in a mysterious bunker with two men named Howard and Emmett. Howard offers her a pair of crutches to help her remain mobile with her leg injury sustained from the car crash and tells her to \"get good on those\" before leaving the bunker. She has been given the information that there has been an alien attack and the outside world is poisoned. However, Howard and Emmett\'s intentions soon become questionable and Michelle is faced with a question: Is it better in here or out there?','USA','13 wins & 45 nominations.','https://m.media-amazon.com/images/M/MV5BMjEzMjczOTIxMV5BMl5BanBnXkFtZTgwOTUwMjI3NzE@._V1_SX300.jpg','tt1179933','movie',7.2,238,'$59,481,553',97),
(140,'Raw','2016','0000-00-00 00:00:00',99,'Drama, Horror','Raised as a rigorous vegetarian, doe-eyed freshman Justine following in her parents\' footsteps, she is sent off to the reputable Saint-Exupéry Veterinary school where the black sheep of the family, her big sister Alexia, is already studying. There, young virginal Justine, leaving the familial shelter, will abruptly move into a mad new world of school traditions, vicious initiation tests and hard partying, utterly unprepared though for the rough year start only rush week\'s mandatory hazing can offer. As a result, with Alexia reluctantly showing her the ropes but only halfway, Justine during the long-established trial of raw offal-eating, she will be forced to chew over her devout herbivorous beliefs and swallow a fresh chunk of bright-red rabbit kidney, unknowingly descending deep into her uncharted animalistic tendencies. Before long, repulsion will be replaced with an unprecedented, equally unquenched and palpable craving for raw meat, transforming Justine into a monstrous carnivore ravenous for human flesh and a gluttonous meat junkie. Now that Justine\'s corporeal awakening is finally complete, is there a point denying her hunger?','France, Belgium, Italy','16 wins & 37 nominations.','https://ia.media-imdb.com/images/M/MV5BMTU3MDUxMDI0MV5BMl5BanBnXkFtZTgwMzk3OTg3MDI@._V1_SX300.jpg','tt4954522','movie',7.0,39,'$508,425',98),
