(180,'All Three of Us','2015','0000-00-00 00:00:00',102,'Comedy, Drama','Hibat Tabib and his wife Feresteh live in a small village in the South of Iran. They are young, full of life, idealistic and militate actively for democracy. They are not afraid to rise against two successive despots, the Shah first, and later on the Ayatollah Khomeini. In 1984, they are forced to flee their country with their son. After a long, difficult and dangerous journey they end up reaching France. They settle down in the Île-de-France region where, after a period of adjustment, they manage to integrate into the French social fabric, particularly by getting involved in the local community.','France','2 wins & 2 nominations.','https://images-na.ssl-images-amazon.com/images/M/MV5BMjM3NTQ2NzQ4Nl5BMl5BanBnXkFtZTgwNTMzNjQyNzE@._V1_SX300.jpg','tt4057632','movie',7.2,1,'N/A',124),
(181,'Youth','2015','0000-00-00 00:00:00',124,'Comedy, Drama, Music','Fred and Mick, two old friends, are on vacation in an elegant hotel at the foot of the Alps. Fred, a composer and conductor, is now retired. Mick, a film director, is still working. They look with curiosity and tenderness on their children\'s confused lives, Mick\'s enthusiastic young writers, and the other hotel guests. While Mick scrambles to finish the screenplay for what he imagines will be his last important film, Fred has no intention of resuming his musical career. But someone wants at all costs to hear him conduct again.','Italy, France, UK, Switzerland','Nominated for 1 Oscar. Another 16 wins & 53 nominations.','https://ia.media-imdb.com/images/M/MV5BMjI2OTk5MzYyMl5BMl5BanBnXkFtZTgwMzY1MjE3NjE@._V1_SX300.jpg','tt3312830','movie',7.3,59,'$1,882,275',125),
(182,'Mustang','2015','0000-00-00 00:00:00',97,'Drama','Early summer. In a village in northern Turkey, Lale and her four sisters are walking home from school, playing innocently with some boys. The immorality of their play sets off a scandal that has unexpected consequences. The family home is progressively transformed into a prison; instruction in homemaking replaces school and marriages start being arranged. The five sisters who share a common passion for freedom, find ways of getting around the constraints imposed on them.','France, Germany, Turkey, Qatar','Nominated for 1 Oscar. Another 42 wins & 58 nominations.','https://ia.media-imdb.com/images/M/MV5BMTkwODUzODA0OV5BMl5BanBnXkFtZTgwMTA3ODkxNzE@._V1_SX300.jpg','tt3966404','movie',7.6,27,'$560,778',126),
(183,'The Imitation Game','2014','0000-00-00 00:00:00',114,'Biography, Drama, History','Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.','USA','Won 1 Oscar. Another 46 wins & 155 nominations.','https://m.media-amazon.com/images/M/MV5BOTgwMzFiMWYtZDhlNS00ODNkLWJiODAtZDVhNzgyNzJhYjQ4L2ltYWdlXkEyXkFqcGdeQXVyNzEzOTYxNTQ@._V1_SX300.jpg','tt2084970','movie',8.0,577,'N/A',127),
(184,'The Theory of Everything','2014','0000-00-00 00:00:00',123,'Biography, Drama, Romance','The Theory of Everything is the story of the most brilliant and celebrated physicist of our time, Stephen Hawking, and Jane Wilde the arts student he fell in love with whilst studying at Cambridge in the 1960s. Little was expected from Stephen Hawking, a bright but shiftless student of cosmology, given just two years to live following the diagnosis of a fatal illness at 21 years of age. He became galvanized, however, by the love of fellow Cambridge student, Jane Wilde, and he went on to be called the successor to Einstein, as well as a husband and father to their three children. Over the course of their marriage as Stephen\'s body collapsed and his academic renown soared, fault lines were exposed that tested the lineaments of their relationship and dramatically altered the course of both of their lives.','UK, Japan, USA','Won 1 Oscar. Another 24 wins & 121 nominations.','https://m.media-amazon.com/images/M/MV5BMTAwMTU4MDA3NDNeQTJeQWpwZ15BbWU4MDk4NTMxNTIx._V1_SX300.jpg','tt2980516','movie',7.7,332,'$35,887,263',128),
(185,'I Origins','2014','0000-00-00 00:00:00',106,'Drama, Romance, Sci-Fi','I Origins begins when graduate student, Ian Gray, is researching the evolution of human eyes with Karen and Kenny, in order to prove that eyes have evolved instead of \"appeared\" as creationists claim. His fascination with eyes takes him into areas that have profound personal and cultural consequences.','USA','2 wins & 3 nominations.','https://ia.media-imdb.com/images/M/MV5BMTQ0MTAwMDI1OF5BMl5BanBnXkFtZTgwNjUwMTA2MTE@._V1_SX300.jpg','tt2884206','movie',7.4,95,'N/A',129),
