(187,'Me, Myself and Mum','2013','0000-00-00 00:00:00',85,'Comedy','Mrs. Gallienne, a rather temperamental upper middle-class lady, has three children, two of whom she considers as her sons and another she calls Guillaume. Logically indeed, the latter teenage creature does not picture himself as a boy, rather as a girl or at best as a homosexual. But how can a mother act in such an objectionable way? And why? Through a series of painful chain of experiences, Guillaume will discover little by little who he is actually and will manage to break free from her pernicious influence.','France, Belgium','14 wins & 11 nominations.','https://images-na.ssl-images-amazon.com/images/M/MV5BMGM2MzJjNWYtNDk3ZC00OGQ5LTg2MzEtMjlkMjM0MTdlMmQ2XkEyXkFqcGdeQXVyMjkzMDQ1Njc@._V1_SX300.jpg','tt2315200','movie',6.7,6,'N/A',130),
