(199,'It Boy','2013','0000-00-00 00:00:00',92,'Comedy, Romance','The thirty-eight year-old ambitious and workaholic editor of the fashion magazine Rebelle Alice Lantins returns from Brazil to Paris and loses her flash memory in the airplane. However, the student of architecture Balthazar Apfel finds it and calls Alice to tell her. She schedules a meeting in the bar where Balthazar is drinking with his friends but he tells her that the device is at home. He offers a ride in his scooter to Alice and while he is putting the spare helmet on her, two coworkers of Alice see from an angle that make them believe that Balthazar is kissing Alice. They take a photo and posts it in the Twitter. On the next morning, everybody is laughing at Alice but the chief editor and her boss Vincent Khan loves the idea that Alice is dating someone twenty years younger. Alice decides to impersonate that she is in love with Balthazar to get a promotion in the magazine. But soon she learns that she should not trifle with love.','France','1 win.','https://ia.media-imdb.com/images/M/MV5BMTQ3NzcxMjkyNl5BMl5BanBnXkFtZTcwNjYzMDI1OQ@@._V1_SX300.jpg','tt2186812','movie',6.4,7,'N/A',137),
(200,'Prometheus','2012','0000-00-00 00:00:00',124,'Adventure, Mystery, Sci-Fi','This film is set in 2093 and takes place in the same universe as the \'Alien\' movies. A group of explorers, including some archaeologists, are on an \"undisclosed\" mission. They arrive at a moon trillions of miles away from Earth. The team spot what they believe to be signs of civilization. They go to investigate and find more than just signs, they find conclusive evidence. But some of them have an ulterior motive for being there, including the Weyland Corporation. They believe that this is where the human race actually came from. Things soon turn from excitement to survival once inside their discovery.','USA, UK','Nominated for 1 Oscar. Another 6 wins & 46 nominations.','https://m.media-amazon.com/images/M/MV5BMTY3NzIyNTA2NV5BMl5BanBnXkFtZTcwNzE2NjI4Nw@@._V1_SX300.jpg','tt1446714','movie',7.0,518,'$126,464,904',40),
