(204,'Polisse','2011','0000-00-00 00:00:00',127,'Crime, Drama','The daily grind for the cops of the Police Department\'s Juvenile Protection Unit - taking in child molesters, busting underage pickpockets and chewing over relationship issues at lunch; interrogating abusive parents, taking statements from children, confronting the excesses of teen sexuality, enjoying solidarity with colleagues and laughing uncontrollably at the most unthinkable moments. Knowing the worst exists and living with it. How do these cops balance their private lives and the reality they confront every working day? Fred, the group\'s hypersensitive wild card, is going to have a hard time facing the scrutiny of Melissa, a photographer on a Ministry of the Interior assignment to document the unit.','France','7 wins & 22 nominations.','https://ia.media-imdb.com/images/M/MV5BNjQzNzUwNTA3OF5BMl5BanBnXkFtZTcwNDYzNjk2Nw@@._V1_SX300.jpg','tt1661420','movie',7.3,11,'$100,000',141),
(205,'The Intouchables','2011','0000-00-00 00:00:00',112,'Biography, Comedy, Drama','In Paris, the aristocratic and intellectual Philippe is a quadriplegic millionaire who is interviewing candidates for the position of his carer, with his red-haired secretary Magalie. Out of the blue, the rude African Driss cuts the line of candidates and brings a document from the Social Security and asks Phillipe to sign it to prove that he is seeking a job position so he can receive his unemployment benefit. Philippe challenges Driss, offering him a trial period of one month to gain experience helping him. Then Driss can decide whether he would like to stay with him or not. Driss accepts the challenge and moves to the mansion, changing the boring life of Phillipe and his employees.','France','Nominated for 1 Golden Globe. Another 35 wins & 39 nominations.','https://ia.media-imdb.com/images/M/MV5BMTYxNDA3MDQwNl5BMl5BanBnXkFtZTcwNTU4Mzc1Nw@@._V1_SX300.jpg','tt1675434','movie',8.5,617,'$13,179,837',142),
(206,'The Help','2011','0000-00-00 00:00:00',146,'Drama','Set in Mississippi during the 1960s, Skeeter (Stone) is a southern society girl who returns from college determined to become a writer, but turns her friends\' lives -- and a Mississippi town -- upside down when she decides to interview the black women who have spent their lives taking care of prominent southern families. Aibileen (Davis), Skeeter\'s best friend\'s housekeeper, is the first to open up -- to the dismay of her friends in the tight-knit black community. Despite Skeeter\'s life-long friendships hanging in the balance, she and Aibileen continue their collaboration and soon more women come forward to tell their stories -- and as it turns out, they have a lot to say. Along the way, unlikely friendships are forged and a new sisterhood emerges, but not before everyone in town has a thing or two to say themselves when they become unwittingly -- and unwillingly -- caught up in the changing times.','USA, India, United Arab Emirates','Won 1 Oscar. Another 79 wins & 116 nominations.','https://m.media-amazon.com/images/M/MV5BMTM5OTMyMjIxOV5BMl5BanBnXkFtZTcwNzU4MjIwNQ@@._V1_SX300.jpg','tt1454029','movie',8.1,371,'$169,705,587',143),
(207,'Friends with Benefits','2011','0000-00-00 00:00:00',109,'Comedy, Romance','Jamie Rellis (Mila Kunis) is a New York City head-hunter trying to sign Los Angeles-based art director Dylan Harper (Justin Timberlake) for her client. When he takes the job and makes the move, they quickly become friends. Their friendship turns into a friendship with benefits, but with Jamie\'s emotionally damaged past and Dylan\'s history of being emotionally unavailable, they have to try to not fall for each other the way Hollywood romantic comedies dictate.','USA','1 win & 5 nominations.','https://ia.media-imdb.com/images/M/MV5BMTQ2MzQ0NTk4N15BMl5BanBnXkFtZTcwMDc2NDYzNQ@@._V1_SX300.jpg','tt1632708','movie',6.6,302,'$55,802,754',144),
(208,'Paul','2011','0000-00-00 00:00:00',104,'Adventure, Comedy, Sci-Fi','Two sci-fi geeks take a pilgrimage to America\'s UFO heartland. While there, they accidentally meet an alien who brings them on an insane road trip that alters their universe forever. For the past 60 years, an alien named Paul (voiced by Seth Rogen) has been hanging out at a top-secret military base. When he discovers he\'s been taken prisoner, the space-traveling smart ass decides to escape the compound and hop on the first vehicle out of town - a rented RV containing Earthlings Graeme Willy (Simon Pegg) and Clive Gollings (Nick Frost). Chased by federal agents and the fanatical father of a young woman that they accidentally kidnap, Graeme and Clive hatch a fumbling escape plan to return Paul to his mother ship. And as two nerds struggle to help, one little green man might just take his fellow outcasts from misfits to intergalactic heroes.','USA, UK','2 wins & 9 nominations.','https://ia.media-imdb.com/images/M/MV5BMTQzNzAwMTM3MV5BMl5BanBnXkFtZTcwNTE1MTAzNA@@._V1_SX300.jpg','tt1092026','movie',7.0,210,'$37,371,385',145),
(209,'The Social Network','2010','0000-00-00 00:00:00',120,'Biography, Drama','On a fall night in 2003, Harvard undergrad and computer programming genius Mark Zuckerberg sits down at his computer and heatedly begins working on a new idea. In a fury of blogging and programming, what begins in his dorm room soon becomes a global social network and a revolution in communication. A mere six years and 500 million friends later, Mark Zuckerberg is the youngest billionaire in history... but for this entrepreneur, success leads to both personal and legal complications.','USA','Won 3 Oscars. Another 165 wins & 168 nominations.','https://m.media-amazon.com/images/M/MV5BMTM2ODk0NDAwMF5BMl5BanBnXkFtZTcwNTM1MDc2Mw@@._V1_SX300.jpg','tt1285016','movie',7.7,542,'$96,400,000',27),
(210,'Saw','2004','0000-00-00 00:00:00',103,'Crime, Horror, Mystery','Waking up in a undisclosed location in a unknown room two men, adam and gordon are trapped into a single room with a dead body. Given random tools with riddles hidnen around the room. Wondering who could have done this there are clues to who might of done it; the jigsaw killer. The question is not just who but why would a serial killer leave two men in a room. Both adam and gordon hiding secrets they must trust and work together to get out or die...can they survive jigsaws game or die trying?','USA','8 wins & 10 nominations.','https://ia.media-imdb.com/images/M/MV5BMzQ2ZTBhNmEtZDBmYi00ODU0LTgzZmQtNmMxM2M4NzM1ZjE4XkEyXkFqcGdeQXVyNjE5MjUyOTM@._V1_SX300.jpg','tt0387564','movie',7.6,335,'$55,100,000',131),
(211,'American Pie','1999','0000-00-00 00:00:00',95,'Comedy','Jim, Oz, Finch and Kevin are four friends who make a pact that before they graduate they will all lose their virginity. The hard job now is how to reach that goal by prom night. Whilst Oz begins singing to grab attention and Kevin tries to persuade his girlfriend, Finch tries any easy route of spreading rumors and Jim fails miserably. Whether it is being caught on top of a pie or on the Internet, Jim always ends up with his trusty sex advice from his father. Will they achieve their goal of getting laid by prom night? Or will they learn something much different?','USA','9 wins & 14 nominations.','https://ia.media-imdb.com/images/M/MV5BMTg3ODY5ODI1NF5BMl5BanBnXkFtZTgwMTkxNTYxMTE@._V1_SX300.jpg','tt0163651','movie',7.0,340,'N/A',146),
(212,'The Reader','2008','0000-00-00 00:00:00',124,'Drama, Romance','THE READER opens in post-war Germany when teenager Michael Berg becomes ill and is helped home by Hanna, a stranger twice his age. Michael recovers from scarlet fever and seeks out Hanna to thank her. The two are quickly drawn into a passionate but secretive affair. Michael discovers that Hanna loves being read to and their physical relationship deepens. Hanna is enthralled as Michael reads to her from \"The Odyssey,\" \"Huck Finn\" and \"The Lady with the Little Dog.\" Despite their intense bond, Hanna mysteriously disappears one day and Michael is left confused and heartbroken. Eight years later, while Michael is a law student observing the Nazi war crime trials, he is stunned to find Hanna back in his life - this time as a defendant in the courtroom. As Hanna\'s past is revealed, Michael uncovers a deep secret that will impact both of their lives. THE READER is a story about truth and reconciliation, about how one generation comes to terms with the crimes of another.','USA, Germany','Won 1 Oscar. Another 25 wins & 47 nominations.','https://ia.media-imdb.com/images/M/MV5BMTM0NDQxNjA0N15BMl5BanBnXkFtZTcwNDUwMzcwMg@@._V1_SX300.jpg','tt0976051','movie',7.6,207,'$34,111,418',147),
(213,'Seven Pounds','2008','0000-00-00 00:00:00',123,'Drama, Romance','Haunted by a secret, Ben Thomas looks for redemption by radically transforming the lives of seven people he doesn\'t know. Once his plan is set, nothing will be able to stop him. At least that\'s what he thinks. But Ben hadn\'t planned on falling in love with one of these people and she\'s the one who will end up transforming him.','USA','5 wins & 6 nominations.','https://ia.media-imdb.com/images/M/MV5BMTU0NzY0MTY5OF5BMl5BanBnXkFtZTcwODY3MDEwMg@@._V1_SX300.jpg','tt0814314','movie',7.6,257,'$69,951,824',148),
(214,'WALL·E','2008','0000-00-00 00:00:00',98,'Animation, Adventure, Family','In a distant, but not so unrealistic, future where mankind has abandoned earth because it has become covered with trash from products sold by the powerful multi-national Buy N Large corporation, WALL-E, a garbage collecting robot has been left to clean up the mess. Mesmerized with trinkets of Earth\'s history and show tunes, WALL-E is alone on Earth except for a sprightly pet cockroach. One day, EVE, a sleek (and dangerous) reconnaissance robot, is sent to Earth to find proof that life is once again sustainable. WALL-E falls in love with EVE. WALL-E rescues EVE from a dust storm and shows her a living plant he found amongst the rubble. Consistent with her \"directive\", EVE takes the plant and automatically enters a deactivated state except for a blinking green beacon. WALL-E, doesn\'t understand what has happened to his new friend, but, true to his love, he protects her from wind, rain, and lightning, even as she is unresponsive. One day a massive ship comes to reclaim EVE, but WALL-E, out of love or loneliness, hitches a ride on the outside of the ship to rescue EVE. The ship arrives back at a large space cruise ship, which is carrying all of the humans who evacuated Earth 700 years earlier. The people of Earth ride around this space resort on hovering chairs which give them a constant feed of TV and video chatting. They drink all of their meals through a straw out of laziness and/or bone loss, and are all so fat that they can barely move. When the auto-pilot computer, acting on hastily-given instructions sent many centuries before, tries to prevent the people of Earth from returning by stealing the plant, WALL-E, EVE, the portly captain, and a band of broken robots stage a mutiny.','USA','Won 1 Oscar. Another 89 wins & 90 nominations.','https://m.media-amazon.com/images/M/MV5BMjExMTg5OTU0NF5BMl5BanBnXkFtZTcwMjMxMzMzMw@@._V1_SX300.jpg','tt0910970','movie',8.4,846,'$223,749,872',149),
(215,'I Am Legend','2007','0000-00-00 00:00:00',101,'Drama, Horror, Sci-Fi','Robert Neville is a scientist who was unable to stop the spread of the terrible virus that was incurable and man-made. Immune, Neville is now the last human survivor in what is left of New York City and perhaps the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone. Mutant victims of the plague -- The Infected -- lurk in the shadows... watching Neville\'s every move... waiting for him to make a fatal mistake. Perhaps mankind\'s last, best hope, Neville is driven by only one remaining mission: to find a way to reverse the effects of the virus using his own immune blood. But he knows he is outnumbered... and quickly running out of time.','USA','9 wins & 22 nominations.','https://m.media-amazon.com/images/M/MV5BYTE1ZTBlYzgtNmMyNS00ZTQ2LWE4NjEtZjUxNDJkNTg2MzlhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg','tt0480249','movie',7.2,604,'$256,399,999',150),
(216,'Ocean\'s Thirteen','2007','0000-00-00 00:00:00',122,'Crime, Thriller','The last time we saw Danny Ocean\'s crew, they were paying back ruthless casino mogul Terry Benedict after stealing millions from him. However, it\'s been a while since they\'ve come back together, which is all about to change. When one of their own, Reuben Tishkoff, builds a hotel with another casino owner, Willy Bank, the last thing he ever wanted was to get cut out of the deal personally by the loathsome Bank. Bank\'s attitude even goes so far as to finding the amusement in Tishkoff\'s misfortune when the double crossing lands Reuben in the hospital because of a heart attack. However, Danny and his crew won\'t stand for Bank and what he\'s done to a friend. Uniting with their old enemy Benedict, who himself has a vendetta against Bank, the crew is out to pull off a major plan; one that will unfold on the night Bank\'s newest hot spot opens up. They\'re not in this for the money, but for the revenge.','USA','1 win & 5 nominations.','https://ia.media-imdb.com/images/M/MV5BMTMyNTc1NzY5MV5BMl5BanBnXkFtZTcwNDM4NTQzMw@@._V1_SX300.jpg','tt0496806','movie',6.9,282,'$78,864,724',151),
(217,'Ocean\'s Eleven','2001','0000-00-00 00:00:00',116,'Crime, Thriller','Danny Ocean wants to score the biggest heist in history. He combines an eleven member team, including Frank Catton, Rusty Ryan and Linus Caldwell. Their target? The Bellagio, the Mirage and the MGM Grand. All casinos owned by Terry Benedict. It\'s not going to be easy, as they plan to get in secretly and out with $150 million.','USA','4 wins & 20 nominations.','https://ia.media-imdb.com/images/M/MV5BYzVmYzVkMmUtOGRhMi00MTNmLThlMmUtZTljYjlkMjNkMjJkXkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_SX300.jpg','tt0240772','movie',7.8,449,'$183,349,128',151),
