(226,'Harry Potter and the Goblet of Fire','2005','0000-00-00 00:00:00',157,'Adventure, Family, Fantasy','Harry\'s fourth year at Hogwarts is about to start and he is enjoying the summer vacation with his friends. They get the tickets to The Quidditch World Cup Final but after the match is over, people dressed like Lord Voldemort\'s \'Death Eaters\' set a fire to all the visitors\' tents, coupled with the appearance of Voldemort\'s symbol, the \'Dark Mark\' in the sky, which causes a frenzy across the magical community. That same year, Hogwarts is hosting \'The Triwizard Tournament\', a magical tournament between three well-known schools of magic : Hogwarts, Beauxbatons and Durmstrang. The contestants have to be above the age of 17, and are chosen by a magical object called Goblet of Fire. On the night of selection, however, the Goblet spews out four names instead of the usual three, with Harry unwittingly being selected as the Fourth Champion. Since the magic cannot be reversed, Harry is forced to go with it and brave three exceedingly difficult tasks.','UK, USA','Nominated for 1 Oscar. Another 13 wins & 42 nominations.','https://m.media-amazon.com/images/M/MV5BMTI1NDMyMjExOF5BMl5BanBnXkFtZTcwOTc4MjQzMQ@@._V1_SX300.jpg','tt0330373','movie',7.7,452,'$289,994,397',156),
(227,'Harry Potter and the Prisoner of Azkaban','2004','0000-00-00 00:00:00',142,'Adventure, Family, Fantasy','Harry Potter is having a tough time with his relatives (yet again). He runs away after using magic to inflate Uncle Vernon\'s sister Marge who was being offensive towards Harry\'s parents. Initially scared for using magic outside the school, he is pleasantly surprised that he won\'t be penalized after all. However, he soon learns that a dangerous criminal and Voldemort\'s trusted aide Sirius Black has escaped from the Azkaban prison and wants to kill Harry to avenge the Dark Lord. To worsen the conditions for Harry, vile creatures called Dementors are appointed to guard the school gates and inexplicably happen to have the most horrible effect on him. Little does Harry know that by the end of this year, many holes in his past (whatever he knows of it) will be filled up and he will have a clearer vision of what the future has in store...','UK, USA','Nominated for 2 Oscars. Another 14 wins & 45 nominations.','https://ia.media-imdb.com/images/M/MV5BMTY4NTIwODg0N15BMl5BanBnXkFtZTcwOTc0MjEzMw@@._V1_SX300.jpg','tt0304141','movie',7.8,448,'$249,358,727',49),
