(339,'Ferris Bueller\'s Day Off','1986','0000-00-00 00:00:00',103,'Comedy','High school student Ferris Bueller wants a day off from school and he\'s developed an incredibly sophisticated plan to pull it off. He talks his friend Cameron into taking his father\'s prized Ferrari and with his girlfriend Sloane head into Chicago for the day. While they are taking in what the city has to offer school principal Ed Rooney is convinced that Ferris is, not for the first time, playing hooky for the day and is hell bent to catch him out. Ferris has anticipated that, much to Rooney\'s chagrin.','USA','Nominated for 1 Golden Globe. Another 1 win.','https://m.media-amazon.com/images/M/MV5BMDA0NjZhZWUtNmI2NC00MmFjLTgwZDYtYzVjZmNhMDVmOTBkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0091042','movie',7.8,279,'N/A',204),
