(343,'Aliens vs. Predator: Requiem','2007','0000-00-00 00:00:00',94,'Action, Horror, Sci-Fi, Thriller','Following the events of Alien vs. Predator, and the maturation of the chestburster that erupted from the body of Scar (the Predator that defeated the Alien Queen) into an adult Predalien, the Predator scout ship crashes in the woods of Gunnison County. A local, Buddy Benson, and his son, Sam, are hunting in the forest and witness the crash, but they are chased and are implanted with alien embryos by facehuggers along with several homeless people living in the sewers. Meanwhile another Predator lands seeking out the Alien and destroying evidence of their presence on Earth. The dwellers of the town find themselves in the middle of a battlefield between the two deadly extraterrestrial creatures, and the small group of survivors splits between the leadership of Sheriff Eddie Morales and the bad-boy Dallas Howard. Both have different opinions about the best means to escape from the beings.','USA','4 nominations.','https://m.media-amazon.com/images/M/MV5BMTI5NDY2NDUwM15BMl5BanBnXkFtZTYwNzQxMTA3._V1_SX300.jpg','tt0758730','movie',4.7,105,'$41,668,854',208),
(344,'Venom','2005','0000-00-00 00:00:00',87,'Fantasy, Horror, Thriller','SPOILER: Eric and his Yankee teenage mates travel South by motorbike to a swampy backwater town in Louisiana, where Sean\'s father Ray lived, the local tow truck driver, who abandoned the then baby-boy and his mother. Ray recently died, while trying to rescue a voodoo witch and at her urging her trunk, which got opened and released the poisonous serpents possessed by the souls of truly evil sinners she trapped in them. Ray was bitten and possessed as the car sunk, and shortly after it\'s dragged out rises as an \'undead\' zombie, who murders without provocation and is immune to lethal weapons. He soon finds the teens\' trace and proves his indiscriminately evil blood-thirst by charging his only offspring equally lethally. However they were warned by Eden\'s friend Cece, the witch\'s granddaughter, who explained the situation in her home and assures them when the zombie attacks it\'s safe thanks to a \'blessed\' spell preventing evil from entering; alas the chain- and crowbar-waving undead finds a way round that: drag them out of it and make it fall apart. After the boys prove too brave and loyal for their own good, only Eden escapes alive, and the battle-site is moved to the tomb where the voodoo evil resides in a sarcophagus for their fight to the (un)death while she sort of learns enough voodoo by trial and error...','USA','N/A','https://m.media-amazon.com/images/M/MV5BZjBmNjhiMTItMjA1Ni00ZDQ2LWFhNGMtN2U2NGZjYzNkOWExXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg','tt0428251','movie',4.7,8,'$811,035',209),
