(364,'The House That Jack Built','2018','0000-00-00 00:00:00',152,'Crime, Drama, Horror','USA in the 1970s. We follow the highly intelligent Jack over a span of 12 years and are introduced to the murders that define Jack\'s development as a serial killer. We experience the story from Jack\'s point of view, while he postulates each murder is an artwork in itself. As the inevitable police intervention is drawing nearer, he is taking greater and greater risks in his attempt to create the ultimate artwork. Along the way we experience Jack\'s descriptions of his personal condition, problems and thoughts through a recurring conversation with the unknown Verge - a grotesque mixture of sophistry mixed with an almost childlike self-pity and psychopathic explanations. The House That Jack Built is a dark and sinister story, yet presented through a philosophical and occasional humorous tale.','Denmark, France, Sweden, Germany, Belgium','N/A','https://m.media-amazon.com/images/M/MV5BNDQ4Y2E5ODktODI5ZS00ZGVkLTgyZTEtNWY1ZjNiZTFjOTE3XkEyXkFqcGdeQXVyODY3Nzc0OTk@._V1_SX300.jpg','tt4003440','movie',6.9,35,'N/A',225),
